import React from 'react';

interface Props {
    value?: string;
}

const sendEvent = (value: string | undefined) => {
    fetch(`https://eutils.ncbi.nlm.nih.gov/entrez/eutils/esearch.fcgi?db=pubmed&retmax=20&retmode=json&term=${value}`)
    .then(response => response.json())
    .then(data => console.log(data));
};

const SearchButton: React.FC<Props> = (props) => {
    const { value } = props;
    return (
        <button className="input-search" onClick={() => sendEvent(value)}>
            Search now
        </button>
    );
};

export default SearchButton;
